import { Box, makeStyles, Paper } from "@material-ui/core";
import axios from "axios";
import { useEffect, useState } from "react";

interface CountType {
  branchCount: number;
  clientCount: number;
  contractCount: number;
  contactCount: number;
}

const useStyles = makeStyles({
  root: {
    minWidth: 275,
  },
  bullet: {
    display: "inline-block",
    margin: "0 2px",
    transform: "scale(0.8)",
  },
  title: {
    fontSize: 14,
  },
  pos: {
    marginBottom: 12,
  },
});
const Count = () => {
  const classes = useStyles();
  const [count, setCount] = useState<CountType>(null);

  useEffect(() => {
    axios
      .get("/api/count/getDashboardData")
      .then(({ data }) => {
        setCount(data);
        console.log(data);
      })
      .catch((err) => console.log(err));
  }, []);
  return (
    <Box m={5}>
      <Paper className={classes.root} elevation={3}>
        Branch Count {count?.branchCount}
      </Paper>
      <Paper className={classes.root} elevation={3}>
        Client Count {count?.clientCount}
      </Paper>
      <Paper className={classes.root} elevation={3}>
        ContactPerson Count {count?.contractCount}
      </Paper>
      <Paper className={classes.root} elevation={3}>
        Contract Count {count?.contractCount}
      </Paper>
    </Box>
  );
};

export default Count;
